import './Expenses.css'

function Expenses(){
    var expenses = [
        {
          id:'e1',
          date: new Date(2022, 2, 25),
          title: 'Toilet Papers',
          amount: 1545.3
        },
        {
          id:'e2',
          date: new Date(2021, 3, 26),
          title: 'New TV',
          amount: 459.3
        },
        {
          id:'e3',
          date: new Date(2020, 4, 27),
          title: 'Car Insurance',
          amount: 779.86
        }
      ]
    return(<div className='expenses'>

    </div>)
    ;
}

export default Expenses;
